import BatStats from "../BatStats/BatStats";
import BallStats from "../BallStats/BallStats";

function Stats(props) {
    return (
        <div className='tournament_stats'>
            <BatStats t_id={props.t_id}/>
            <BallStats t_id={props.t_id}/>
        </div>
    )
}

export default Stats;
